  FT_plaintext.prototype.getExportString = function ( sequence ) {
    var ret = '' ;
    var s = sequence.get('sequence') ;
    while ( s !== '' ) {
      ret += s.substr ( 0 , 60 ) + "\n" ;
      s = s.substr ( 60 , s.length-60 ) ;
    }
    return ret ;
  };

